import React from 'react'
import { NavLink} from 'react-router-dom'

const RoundButton = ({ link, icon}) => {
  return (
    <NavLink className="btn btn-round" to={link}>
        <i className={icon}></i>
        </NavLink>
  )
}

export default RoundButton
